Irgendwie fehlt der #CDU das Fingerspitzengefühl…
Und #Merz steht vor #Adenauergate …

@MeDentify @micky311974 @ARD_Presseclub @phoenix_de @Volker_Herres @Miss_Achtung @CSchwennicke @berndulrich @uwiworks @tagesschau @DasErste @DIEZEIT @SZ DAs nennt man politische Auseinandersetzung… auch wenn die Wahrheit schmerzt…. 

Und wir diskutieren gerade über dieses Thema…. die Diskussion mit mir haben Sie sogar angefangen, nachdem Sie einen Tweed von mir kommentiert haben.

Aber wir müssen das jetzt nicht mehr vertiefen

@MeDentify @ARD_Presseclub @phoenix_de @Volker_Herres @Miss_Achtung @CSchwennicke @berndulrich @uwiworks @tagesschau @DasErste @DIEZEIT @SZ Laschet kann ja nicht die Begründung für die Entschuldigung derFehler bei Baerbock sein. 
Ich erinnere an den hohen moralischen Anspruch und die Behauptung anders zu sein und für Erneuerung zu stehen.
Das ist beim Start der Kampagne kräftig in sie Hose gegangen. Schade.

@MeDentify @micky311974 @ARD_Presseclub @phoenix_de @Volker_Herres @Miss_Achtung @CSchwennicke @berndulrich @uwiworks @tagesschau @DasErste @DIEZEIT @SZ Das sind die  Beschlüsse zum Ausbau Frankfurter Flughafen, Hambacher Forst, Elbvertiefung, Agenda 2010, Kosovoeinsatz, etc.

Da waren ihre Freunde sehr kompromissfähig.
Ich will das nicht kritisieren… nur mal in Erinnerung rufen…

@ARD_Presseclub @phoenix_de @Miss_Achtung Fehler macht jeder…. Wenn da der eigene hohe moralische Anspruch nicht wäre, der scheinbar nur für andere gilt…. 
Da ist mehr Schein als Sein…. Und das zieht sich wie ein grüner Faden durch das Reden und HANDELN!

Anspruch und Wirklichkeit der Erneuerung!

@MeDentify @ARD_Presseclub @phoenix_de @Volker_Herres @Miss_Achtung @CSchwennicke @berndulrich @uwiworks @tagesschau @DasErste @DIEZEIT @SZ Darf man in diesem Land nur eine Meinung haben, wenn die Umfragewerte passen…. 

Das war nicht mal Meinung, sondern Fakten…
Anspruch und Wirklichkeit der Erneuerung,

@GinKnopf @katarinabarley Sie sind ein kritischer Mensch .. das ist absolut in Ordnung! 
Bei den Grünen lassen Sie viel Nächstenliebe &amp; Vergebung gelten.  Das kann ich mit meinem christl. Menschenbild vereinbaren.
Hauptsache Sie wählen demokratisch und werden nicht zu sehr enttäuscht von der Erneuerung

@SimonSchmi23 @seeheimer Da wurde umgehend gesetzlich und personell reagiert. Ist scheinbar Ihrer geschätzten Aufmerksamkeit entgangen.
Bei Ihrem Denken ist also der Supermarktbetreiber schuldig, wenn Ladendiebstahl passiert? Interessanter Ansatz....
Die Ganoven werden Sie toll finden.

@martinleipert @AnneBressem @EskenSaskia @welt @dieLinke Diese Art von Diskussion bringt uns hier nicht weiter.
Gerne an der Stelle, wo sie hingehört. 
Da haben wir ja genug Möglichkeiten.

